INSERT INTO `products` VALUES (1,'2024-09-08 00:00:00.000000','Hồ Anh Tuấn','Sợi mì vàng dai ngon hòa quyện trong nước súp tôm chua cay thơm lừng, đậm đà thấm đẫm từng sợi mì sóng sánh cùng hương thơm quyến rũ ngất ngây. Lốc 10 gói mì Hảo 100 tôm chua cay gói 65g chính hãng mì Hảo 100  là lựa chọn hấp dẫn không thể bỏ qua cho những bữa ăn nhanh chóng đơn giản mà vẫn đủ chất','https://cdn.tgdd.vn/Products/Images/2565/325755/bhx/mi-hao-100-tom-chua-cay-goi-65g-clone-202405141433496672.jpg',33000,'Lốc 10 gói mì Hảo 100 tôm chua cay gói 65g',73,'Cái','2024-10-20 17:10:03.377466','huygiavu2003@gmail.com',1,0,0),(2,'2024-09-08 00:00:00.000000','Hồ Anh Tuấn','Sản phẩm mì ăn liền cực hot đến từ hãng mì Ottogi với sợi mì Hàn Quốc sợi to vàng dai ngon thấm quyện trong nước sốt mì trộn tương đen Bắc Kinh đậm đà cùng hương thơm quyến cũ, cuốn hút. 30 gói mì tương đen Bắc Kinh Ottogi 83g, chọn lựa vô cùng hấp dẫn cho những tín đồ mì tương đen Hàn Quốc','https://cdn.tgdd.vn/Products/Images/2565/214465/bhx/thung-30-goi-mi-tuong-den-bac-kinh-ottogi-83g-202202211838118393.jpg',204000,'Thùng 30 gói mì tương đen Bắc Kinh Ottogi 83g',167,'Cái','2024-10-20 17:10:03.377466','huygiavu2003@gmail.com',1,0,0),(3,'2024-09-08 00:00:00.000000','Hồ Anh Tuấn','Sợi mì vàng dai ngon hòa quyện trong nước súp tôm chua cay đậm đà thấm từng sợi cùng hương thơm quyến rũ ngất ngây. 12 ly mì Mini Handy Hảo Hảo vị tôm chua cay 47g chính hãng mì Hảo Hảo là lựa chọn hấp dẫn không thể bỏ qua đặc biệt là cho những ngày bận rộn cần bổ sung năng lượng nhanh chóng','https://cdn.tgdd.vn/Products/Images/2565/225463/bhx/thung-12-ly-mi-an-lien-mini-handy-hao-hao-vi-tom-chua-cay-47g-202202211823141935.jpg',83000,'Thùng 12 ly mì ăn liền Mini Handy Hảo Hảo tôm chua cay 47g',112,'Cái','2024-10-23 14:28:11.533531','huygiavu2003@gmail.com',1,0,1),(4,'2024-09-08 00:00:00.000000','Hồ Anh Tuấn','Sợi mì vàng dai ngon hòa quyện trong nước súp sa tế thơm lừng, đậm đà thấm đẫm từng sợi mì sóng sánh cùng hương hành phi quyến rũ ng